import React from "react";

function Bar() {
  // Generate random stock values for the bar chart
  const stockValues = [45.32, 50.21, 48.75, 52.1, 49.8];

  return (
    <div>
      <h2>Bar Chart</h2>
      <div>
        {stockValues.map((value, index) => (
          <div
            key={index}
            style={{
              height: `${value}px`,
              backgroundColor: `rgb(${Math.floor(
                Math.random() * 256
              )}, ${Math.floor(Math.random() * 256)}, ${Math.floor(
                Math.random() * 256
              )})`,
              margin: "5px",
            }}
          ></div>
        ))}
      </div>
    </div>
  );
}

export default Bar;
